import React, { useState } from 'react';
import { Animated, View, Dimensions } from 'react-native';
import Svg, {
  Path, Defs, Pattern, Use, Image
} from 'react-native-svg';

const Mock = ({
  maskCenterX, maskCenterY, maskWidth, maskHeight, mockScale, mockOpacity, mockRotate
}) => {
  // Mock device
  const mockSize = 0.8;
  const mockWidth = maskWidth * mockSize;
  const mockHeight = maskHeight * mockSize;
  const mockCenterX = maskCenterX;
  const mockCenterY = maskCenterY;

  const sizeHorizont = Dimensions.get('window').width > 400 ? 70 : 40;
  const sizeVErtical = Dimensions.get('window').height > 800 ? 50 : 20;

  const mockSpin = mockRotate.interpolate({
    inputRange: [-1, 1],
    outputRange: ['-5deg', '5deg']
  });

  return (
    <Animated.View style={{
      opacity: mockOpacity,
      transform: [
        { scale: mockScale },
        { rotateZ: mockSpin },
        { perspective: 1000 },
        // without above line this Animation will not render on Android while working fine on iOS
      ]
    }}
    >
      <View style={{
        position: 'absolute',
        top: mockCenterX / 2 + sizeVErtical,
        left: mockCenterY / 2 - sizeHorizont,
      }}
      >
        <Svg
          width={mockWidth}
          height={mockHeight}
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
        >
          <Path fill="url(#a)" d="M0 0h143v426H0z" />
          <Defs>
            <Pattern
              id="a"
              patternContentUnits="objectBoundingBox"
              width={1}
              height={1}
            >
              <Use xlinkHref="#b" transform="matrix(.00683 0 0 .0023 -1.15 -.18)" />
            </Pattern>
            <Image
              id="b"
              width={433}
              height={577}
              xlinkHref="data:image/png;base64,"
            />
          </Defs>
        </Svg>
      </View>
    </Animated.View>
  );
};

export default Mock;
